  false,\n\t\"url\": null,\n\t\"notes\": \"The Lahontan Valley contains approximately
  48,745 acres of wetland habitat. The size of the areas range from small seep ponds
  of less than an acre to management areas having up to 20,000 acres of marsh. The
  wetlands supported 31,959,103 waterfowl use days and produced 24,431 young waterfowl.
  Annual use for marsh and shorebirds was 9,133,200 days. Production was estimated
  at 32,804. Impoundments which maintain sizable fish populations were identified.
  The Carson Lake area and the Stillwater Wildlife Management Area contained most
  of the wetland and supported most of the wildlife. Hunting and fishing are the main
  recreational uses, although nonconsumptive wildlife related activities, such as
  observation and photography are increasing. The total use in the valley amounted
  to 60,635 visits. Annual productivity of a marsh was measured by inventorying the
  submergent and emergent vegetation. Of the 18,741 acres of water surveyed, 4,935
  acres contained submergent vegetation. Emergent vegetation covered approximately
  5,746 acres. Seasonal fluctuations in water levels and changes in the total dissolved
  salt concentrations appear to be related to the irrigation season. Economic benefits
  derived from grazing and muskrat trapping are considerable.\",\n\t\"owner_org\":
